INSERT INTO `destinations` (`id`, `destination_name`, `description`, `rating`, `longlat`, `image`, `category`, `popularity`)
VALUES
	(1, 'Air Terjun Montel', 'Air Terjun Montel berlokasi tak jauh dari makam Sunan Muria, dan berada di kawasan Gunung Muria. Menjadi salah satu air terjun di Kudus yang wajib untuk dikunjungi', 4, '-6.6607359,110.886609', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fmontel.jpg?alt=media&token=b1e33057-2865-4c2c-b703-a2db419ed628', 'alam', 12),
	(2, 'Air Terjun Gonggomino', 'Air terjun/curug merupakan salah satu objek wisata alam yang menjadi pilihan wisatawan untuk melepas penat dari segala aktivitas ataupun sekedar berwisata. Suara air terjun yang dianggap menentramkan dan menyejukkan pikiran menjadi salah satunya.', 4, '-6.6504237,110.9029331', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fgonggomino.jpg?alt=media&token=99ef5ae6-d57f-4802-913c-d9c9a87591c5', 'alam', 2),
	(3, 'Watereboom Mulia Kudus', 'Waterpark Mulia Wisata menyuguhkan taman rekreasi bermain air yang seru, asyik dan pastinya menarik. Dengan banyak pilihan kolam dan wahana di dalamnya yang bikin momen liburan kali ini semakin berkesan dan sulit terlupakan.', 4, '-6.7111905,110.8803116', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fwaterboom-mulia.webp?alt=media&token=5e8cc7e0-c35f-41bb-80fe-6414916e59f0', 'alam', 2),
	(4, 'Museum Kretek', 'Museum Kretek adalah salah satu museum yang terletak di Kudus, Jawa Tengah (Jateng). Museum Kretek merupakan museum khusus yang memperkenalkan sejarah tentang kretek. Dibangun dan diresmikan pada tanggal 3 Oktober 1986 silam.', 4, '-6.825822504027947, 110.83871621147891', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fmuseum-kretek.jpg?alt=media&token=970609ac-71ad-47a4-b021-ef03ebf02706', 'alam', 2),
	(5, 'Menara Kudus', ' Menara Kudus merupakan salah satu masjid tua di Pulau Jawa yang memiliki bangunan dan saksi akulturasi antara kebudayaan Jawa, Hindu, dan Islam. Masjid ini berlokasi di Jalan Menara, Desa Kauman, Kecamatan Kota, Kabupaten Kudus, Jawa Tengah, sekitar 1,5 km dari pusat Kota Kudus.', 5, '-6.804019947119528, 110.83282569302318', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fmenara.jpg?alt=media&token=4b33d628-dbde-4122-bad1-ee7455aa5aca', 'alam', 2),
	(6, 'Desa Wisata Rahtawu', 'Dengan ketinggian ± 1.627 m dari permukaan air laut, di desa tersebut kamu dapat menikmati panorama alam pegunungan yang asri dan indah memesona dengan udara yang bersih, segar dan sejuk. Tidak hanya itu, saja kamu juga bisa dengan leluasa menikmati potensi wisata alam dari atas pegunungan Muria. Mulai dari wisata alam hingga mampir makan-makanan khas Rahtawu aneka kuliner Enthog.', 4, '-6.6806631411764945, 110.85438160207828', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fdesa-rahtawu.png?alt=media&token=9abf4c53-f0c0-4770-9a86-169fc1aad032', 'alam', 2),
	(7, 'Air Tiga Rasa Rajenu', 'Air Tiga Rasa Rejenu terdapat di Desa Japan, Kecamatan Dawe, Kabupaten Kudus, tepatnya di atas Air Terjun Monthel. Lokasinya terletak di sebelah utara makam Sunan Muria, di atas objek air terjun Montel. Di sini terdapat sebuah makam yang banyak diziarahi orang. Orang mengenalnya sebagai makam Syeh Sadzali. Salah satu murid Sunan Muria yang disegani, yang konon berasal dari Irak', 5, '-6.650875304065295, 110.90264929276749', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Frajenu.jpg?alt=media&token=7ede61f4-c5c6-4f7e-8539-7305bb5f494b', 'alam', 2),
	(8, 'Gray Canyon Kudus', 'Awalnya Gray Canyon merupakan lokasi galian C yaitu usaha penambangan. Seperti halnya yang berupa pertambangan tanah, pasir, kerikil, marmer, kaolin, granit, dan masih banyak yang lain lagi. Meski tidak memiliki wahana wisata layaknya tempat wisata pada umumnya', 4, '-6.766631327617091, 110.91761502160568', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fcanyon.jpg?alt=media&token=82c42ca1-4a13-4003-a9c1-cc9c4c41d3ef', 'alam', 2),
	(9, 'Perkemahan Kajar', 'Bumi Perkemahan Kajar Terletak di Desa Kajar, Kecamatan Dawe Kabupaten Kudus sekitar 2 km arah selatan Makam Sunan Muria. kawasan wisata dan bumi perkemahan Kajar mempunyai ketinggian sekitar 600 meter dpl (di atas permukaan laut).', 4, '-6.678103651178264, 110.89170122712981', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fperkemahan-kajar.jpg?alt=media&token=1ca2bded-8d65-4fcb-bec8-66f050ce5396', 'alam', 12),
	(10, 'Taman Oasis', 'Salah satu kawasan wisata publik dan perkantoran terpadu di Kabupaten Kudus. Memiliki lahan seluas kurang lebih 85 hektare. Berlokasi di Jalan Lingkar Utara, Desa Bacin, Kecamatan Bae. Mulai dibangun pada 2005 dan selesai pada 2012. Dimiliki dan dikelola oleh PT Djarum Kudus.', 5, '-6.783431553087101, 110.85927148073768', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Foasis.jpg?alt=media&token=40f38ab4-972f-473c-a4af-4459fd0a7731', 'nongki', 2),
	(11, 'Situs Pati Ayam', 'Museum Situs Patiayam merupakan museum khusus yang menampung temuan dari daerah situs Patiayam. Museum ini menginformasikan mengenai kehidupan manusia beserta lingkungannya pada masa Plestosen. Museum ini mulai didirikan pada tahun 2004. Museum Situs Patiayam memiliki koleksi berjumlah 99 yang ditampilkan pada display. ', 4, '-6.793398327286098, 110.93832533891398', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fpati-ayam.jpg?alt=media&token=dd54593c-4a5a-4a91-8294-8465862d0036', 'alam', 2),
	(12, 'Menara Pisang', 'Wisata Menara Pisang di Dawe Kudus Jawa Tengah adalah salah satu tempat wisata yang berada di dukuh Watu Lumpang, Desa Kajar, Kecamatan Dawe, Kabupaten Kudus, Jawa Tengah, Indonesia. Wisata Menara Pisang di Dawe Kudus Jawa Tengah adalah tempat wisata yang ramai dengan wisatawan pada hari biasa maupun hari liburan. Tempat ini sangat indah dan bisa memberikan sensasi yang berbeda dengan aktivitas kita sehari hari.', 4, '-6.702903137428071, 110.88603188064373', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fmenara-pisang.jpg?alt=media&token=94f28fab-5589-4555-b3c7-1f25d0f4b7ae', 'alam', 2),
	(13, 'Air Terjun Pengantin', 'Air Terjun Pengantin sudah terkenal sejak judul film layar lebar yang dibintangi artis cantik Tamara Bleszynski pada tahun 2009 lalu meskipun lokasi syutingnya bukan di Air Terjun Kudus', 4, '-6.697233492068962, 110.87725653695023', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fair-terjun-pengantin.jpeg?alt=media&token=c236106d-b687-41c8-8b1f-54b07cb8305b', 'alam', 2),
	(14, 'Air Terjun Banteng Rahtawu', 'Sejak tahun 2018 Air Terjun Banteng dikelola dengan baik antara pemerintah desa setempat dengan beberapa pihak terkait. Sehingga kini dapat menjadi referensi tempat wisata ketika berada di Kudus, khususnya di Desa Rahtawu.', 4, '-6.6440550823101825, 110.86795692345872', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fair-terjun-banteng.JPG?alt=media&token=898a5964-b73e-4152-bf24-18c4c5d12681', 'alam', 2),
	(15, 'Gua Jepang Colo', 'Gua Jepang terletak di lereng Gunung Muria, tempatnya tidak jauh dari objek wisata di dekat Desa Colo yaitu air tiga rasa, dan hanya bisa dilalui dengan berjalan kaki.', 4, '-6.766996882995542, 110.94083345427', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fgua-jepang.jpeg?alt=media&token=402a8680-f7e7-4489-aa04-30c34c25290f', 'alam', 2),
	(16, 'The Peak Waterboom', 'Kudus Kota Kretek tidak hanya menyajikan wisata sejarah yang menawan hati. Namun, siapa sangka, kota ini pun menyediakan destinasi rekreasi air yang memikat. Salah satunya di The Peak View Waterboom & Resto. Destinasi yang tak hanya menyuguhi wisata alam Kudus, tapi juga arena bermain air.', 4, '-6.780127217804236, 110.8704899369516', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fthe-peak.jpg?alt=media&token=d9165e38-44c5-47fa-bba0-3aa49f67888a', 'renang', 2),
	(17, 'Puncak 29', 'Puncak 29 atau Songolikur merupakan satu puncak dari Gunung Muria berada pada ketinggian lebih dari 1.600 mdpl. Berbicara akan keindahan alamnya tentu sudah tidak kita ragukan lagi karena view yang ijo menghiasi kabut tipis menjadi pemandangan utamanya.', 5, '-6.616293322148556, 110.88934099588981', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fpuncak29.jpg?alt=media&token=5643b1d5-b659-4bc5-9419-53a023be9003', 'alam', 2),
	(18, 'Air Terjun Ternadi', 'Air Terjun Ternadi memiliki ketinggian sekitar 30 m dengan kolam penampungan di bawahnya.  Air terjun ini berdekatan dengan (di atas) Makam Sunan Kaliyetno dan objek wisata Watu Payung', 4, '-6.672709584324997, 110.88307030928576', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fair-terjun-ternadi.jpg?alt=media&token=a7936861-a8fa-4c96-9ef9-05da137499cc', 'alam', 2),
	(19, 'Air Terjun Kedung Gender', 'Di Desa Dukuhwaringin Kecamatan Dawe, Kudus ternyata menyimpan pesona wisata alam yang mempesona. Namanya adalah air terjun Kedung Gender.', 5, '-6.6736657149297685, 110.90917198853595', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fair-terjun-kedung-gender.jpg?alt=media&token=d033ab74-e609-461e-8e72-fdec1f2d6f73', 'alam', 33),
	(20, 'Gunung Muria Kudus', 'Di Desa Dukuhwaringin Kecamatan Dawe, Kudus ternyata menyimpan pesona wisata alam yang mempesona. Namanya adalah air terjun Kedung Gender.', 4, '-6.615557657257895, 110.89126210412712', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fgunung-muria.jpg?alt=media&token=5e740e64-b2e8-4b5c-ae8f-c37cb9fe376e', 'alam', 2),
	(21, 'Sendang Jodo', 'Di Dukuh Jambean, Desa Purworejo, Kecamatan Bae, Kabupaten Kudus terdapat sumber mata air bernama Sendang Jodo. Konon, air sendang berukuran empat meter persegi tersebut dipercaya masyarakat sekitar mempunyai banyak khasiat, di antaranya untuk memperlancar jodoh.', 4, '-6.778993301201402, 110.8554504483068', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fsendang-jodo.jpg?alt=media&token=b9b01fe4-2a4d-4096-8188-4a67bde0100f', 'alam', 2),
	(22, 'Desa Wisata Wonosoco', 'Desa Wisata Wonosoco memiliki destinasi wisata alam yang  terdiri dari wisata goa, sendang, dan wisata budaya, yakni petilasan. Kegiatan budaya disuguhkan oleh masyarakat Wonosoco secara rutin tiap tahun adalah KIRAB RESIK-RESIK SENDANG', 4, '-6.972688629067119, 110.81063729110711', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fwonosoco.jpg?alt=media&token=5f96859b-66db-40d5-9110-d970dc99b664', 'alam', 2),
	(23, 'Desa Wisata Jurang Gebog', 'Jurang merupakan sebuah desa yang berada di Kecamatan Gebog, Kabupaten Kudus, Jawa Tengah. Desa Jurang sendiri berada pada kawasan lereng gunung muria dan secara geografis sendiri dilintasi oleh sungai gelis, sungai yang membelah Kota Kudus', 5, '-6.722486336363031, 110.8549299027247', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fjurang-gebog.jpg?alt=media&token=adfdfba3-41f0-4a31-a706-f8f967727161', 'alam', 2),
	(24, 'Gerbang Kudus Kota Kretek', 'adalah sebuah monumen berupa gerbang masuk kota yang berada di kawasan Taman Tanggul Angin, Kecamatan Jati, Kabupaten Kudus. Monumen ini melambangkan kota asal dari rokok kretek yaitu Kudus. Gerbang Kudus Kota Kretek ini diklaim termegah di Indonesia', 5, '-6.842406571730585, 110.81542318989017', 'https://firebasestorage.googleapis.com/v0/b/aerojs.appspot.com/o/destination%2Fgerbang-kudus.JPG?alt=media&token=b5acaa6c-f1f7-48d2-bab6-e578b61a0d95', 'nongki', 3);
